        <style>
            #map {
                height: 500px;
                width: auto;
                border-width: 2px;
                border-radius: 4px;	
                border-color: #000000;
            }
            #textBox{
                width: 200px;
                height: 100px;
                border-width: 2px;
                border-color: black;
                text-align: top;
                padding: 10px 10px;
            }
            .popup{
                background-color: #777777;
                width: 420px;
                padding: 30px 40px;
                position: absolute;
                transform: translate(-50%,-50%);
                border-radius: 8px;
                border-width: 5px;
                border-color: black;
                display: none;
                font-family: "Poppins",sans-serif;
                text-align: center;
            }
            .popup button{
                display: block;
                margin:  0 0 20px auto;
                background-color: transparent;
                font-size: 30px;
                color: #ffffff;
                background: #03549a;
                border-radius: 100%;
                width: 40px;
                height: 40px;
                border: none;
                outline: none;
                cursor: pointer;
            }
            .open-button {
            background-color: #555;
            color: white;
            padding: 16px 20px;
            border: none;
            cursor: pointer;
            opacity: 0.8;
            position: fixed;
            bottom: 23px;
            right: 28px;
            width: 280px;
            }

            /* The popup form - hidden by default */
            .form-popup {
            display: none;
            position: fixed;
            bottom: 0;
            right: 15px;
            border: 3px solid #f1f1f1;
            z-index: 9;
            }

            /* Add styles to the form container */
            .form-container {
            max-width: 400px;
            padding: 10px;
            background-color: white;
            }

            /* Full-width input fields */
            .form-container input[type=text], .form-container input[type=password] {
            width: 100%;
            padding: 15px;
            margin: 5px 0 22px 0;
            border: none;
            background: #f1f1f1;
            }

            /* When the inputs get focus, do something */
            .form-container input[type=text]:focus, .form-container input[type=password]:focus {
            background-color: #ddd;
            outline: none;
            }

            /* Set a style for the submit/login button */
            .form-container .btn {
            background-color: #04AA6D;
            color: white;
            padding: 16px 20px;
            border: none;
            cursor: pointer;
            width: 100%;
            margin-bottom:10px;
            opacity: 0.8;
            }

            /* Add a red background color to the cancel button */
            .form-container .cancel {
            background-color: red;
            }

            /* Add some hover effects to buttons */
            .form-container .btn:hover, .open-button:hover {
            opacity: 1;
            }
        </style>
    </head>
    <body>
        <div id="mapContainer">
            <div id="map">
            </div>
        </div>
        <input type="text" id="textBox"></input>
        <button class="button" id="submit" onclick="textBoxHandler(document.getElementById('textBox').value);">Filter</button>
        <!--
        <div id="popup">
            <button id="close">&times;</button>
            <div id="selector">
                <select name="drop1" id="Select1"></select>
                <select name="drop2" id="Select2"></select>
                <select name="drop3" id="Select3"></select>
            </div>
            <button id="filter" onclick="filterHandler();">Filter</button>
        </div>
        -->
        <button class="open-button" onclick="openForm()">Open Form</button>

        <div class="form-popup" id="myForm">
        <form action="/action_page.php" class="form-container">
            <h1>Filter</h1>

            <!--<label for="Attribute"><b>Attribute Name</b></label>
            <button id="close">&times;</button>-->
            <div id="selector">
                <select name="drop1" id="Select1"></select>
                <select name="drop2" id="Select2"></select>
                <select name="drop3" id="Select3"></select>
            </div>
            <button id="filter" onclick="filterHandler();">Filter</button>
            <!--
            <label for="Operator"><b>Operator</b></label>
            <input type="password" placeholder="Enter Password" name="psw" required>

            <button type="submit" class="btn">Login</button>
            -->
            <button type="button" class="btn cancel" onclick="closeForm()">Close</button>
        </form>
        </div>
        <script>
            function openForm() {
                document.getElementById("myForm").style.display = "block";
            }
            function closeForm() {
                document.getElementById("myForm").style.display = "none";
            }
            var map = L.map("map", {
                borderPan: true,
                borderPanOffset: 300,
                borderWidth:100,
                center: [28.812255, -96.994662],
                zoomSnap: 0.25,
                zoom: 10,
                zoomControl: false
            });
            new L.Control.Zoom({
                position: "topright"
            }).addTo(map);
            L.control.scale({
                position: "bottomleft"
            }).addTo(map);
            var TX_tile = L.esri.Vector.vectorTileLayer(
                "https://tiles.arcgis.com/tiles/KTcxiTD9dsQw4r7Z/arcgis/rest/services/TxDOT_Vector_Tile_Basemap/VectorTileServer",
                {maxZoom: 20,
                minZoom: 9,
                attribution: 'Vector Tiles by <a href="https://www.txdot.gov/apps/statewide_mapping/StatewidePlanningMap.html">TxDOT, TPP-GIS</a>'}
            ).addTo(map);
            var featureLayer = L.featureGroup(geodata, {
                style: function (feature){
                    return {"color": "red", "weight": 3};
                }
            }).addTo(map);
            var base_sector_layer = L.geoJSON(geodata, {
                style: function (feature){
                    return {"color": "red", "weight": 3};
                }
            }).addTo(featureLayer);
            var drawnItems = new L.FeatureGroup();
            map.addLayer(drawnItems);

            // Initialise the draw control and pass it the FeatureGroup of editable layers
            var drawControl = new L.Control.Draw({
                edit: {
                    featureGroup: drawnItems
                }

        function determineString(str){
            if (isNaN(str)){
                        if (Number(str) === str && str % 1 === 0){
                            return parseInt(str);
                        }
                        else {
                            return parseFloat(str);
                        }
            } else if (str == 'true' || str == 'True' || str == 'TRUE'){
                return true;
            } else if (str == 'false' || str == 'False' || str == 'FALSE'){
                return false;
            } else{
                return str;
            }
        }
        function flipOperator(operator){
            if (operator == ">"){
                return "<";
            } else if (operator == "<"){
                return ">";
            } else if (operator == ">="){
                return "<=";
            } else if (operator == "<="){
                return ">=";
            } else {
                return operator;
            }
        }

                            }

        function layerToLayerSelect(layer1Data, layer2Data, operator){
            if (operator == "AND"){
                var resultData = layer1Data.features.filter(function(feature){
                    return layer2Data.features.includes(feature);
                });
            } else if (operator == "NOT"){
                var resultData = layer1Data.features.filter(function(feature){
                    return !layer2Data.features.includes(feature);
                });
            } else if (operator == "OR"){
                var resultData1 = layer1Data.features.filter(function(feature){
                    return !layer2Data.features.includes(feature);
                });
                var resultData2 = layer2Data.features.filter(function(feature){
                    return !layer1Data.features.includes(feature);
                });
                var resultData3 = layer1Data1.features.filter(function(feature){
                    return layer2Data.features.includes(feature);
                });
                var resultData = resultData1.concat(resultData2);
                resultData = resultData.concat(resultData3);
            } else if (operator == "XOR"){
                var resultData1 = layer1Data.features.filter(function(feature){
                    return !layer2Data.features.includes(feature);
                });
                var resultData2 = layer2Data.features.filter(function(feature){
                    return !layer1Data.features.includes(feature);
                });
                var resultData = resultData1.concat(resultData2);
            } 
        }

        function sortAttribute(attributeName, direction){
            var resultData = geodata;
            if (direction.toUpperCase() == "ascending".toUpperCase()){
                resultData.features.sort(function (a, b) {
                    if (a.properties[attributeName] < b.properties[attributeName]){
                        return -1;
                    } else if (a.properties[attributeName] > b.properties[attributeName]){
                        return 1;
                    }
                });
            }  else if (direction.toUpperCase() == "descending".toUpperCase()){
                resultData.features.sort(function (a, b){
                    if (a.properties[attributeName] < b.properties[attributeName]){
                        return 1;
                    } else if (a.properties[attributeName] > b.properties[attributeName]){
                        return -1;
                    }
                });
            }
            console.log(resultData);
            return resultData;
        }
